import {
  Grid,
  Typography,
  Box,
  FormLabel,
  MenuItem,
  TextField,
} from "@mui/material";
import React, { Fragment } from "react";
import MatterList from "./components/MatterList";

const MatterDashboard = () => {
  return (
    <Fragment>
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          "& > :not(style)": { m: 1 },
        }}
      >
        <Grid container>
          <Grid item>
            <MatterList />
          </Grid>
          <Grid item>
            <Grid container>
              <Grid item>
                <Card sx={{ minWidth: 275 }}>
                  <CardContent>
                    <Typography
                      sx={{ fontSize: 14 }}
                      color="text.secondary"
                      gutterBottom
                    >
                      {data.title}
                    </Typography>
                    <Typography variant="h3" component="h4">
                      {data.amount}
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>
              <Grid item>
                <Card sx={{ minWidth: 275 }}>
                  <CardContent>
                    <Typography
                      sx={{ fontSize: 14 }}
                      color="text.secondary"
                      gutterBottom
                    >
                      {data.title}
                    </Typography>
                    <Typography variant="h3" component="h4">
                      {data.amount}
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </Box>
    </Fragment>
  );
};

export default MatterDashboard;
